text:
이동네 짱게가 주방장님 컨디션에따라 음식맛이 왔다갔다 하는대 24시치고 문안한 곳이에요~ 
오늘 배달기사님이 왕시크하셔서. 봉투안주고 그릇을 제양손에 쥐어주시고는 문도안닫고 그냥 가버리시네요.......
수고하십시오. ㅡ ㅡ ;;

면이 너무 불어서 왔고.. 자장면이 짜워요..;; (짜장을 너무 많이 넣은듯..) 그리고 면이 다 끊겨 있는게.. 꼭 남은 자장면 다 모아놓은듯해서 찝찝함이...ㅠㅠ 
탕수육은 덩어리가 너무 크고.....ㅡㅡ
두번 시켜 먹을곳은 아닌거 같음...;;

리뷰 좋길래 시켯다가 짜장면이 국물도 완전 쫄고
시간도 1시간을 기다리고 짜증낫습니다;;
면에서 밀가루 맛 심하네요;;;
그나마 짬뽕국물만 얼큰하니 좋아서 별2개 드립니다
